import { View } from 'react-native'
import type { Id, Todo } from '../../types'
import TodoListItem from './TodoListItem'
import { logfn } from '../../utils'

interface Props {
  items: Array<Todo>
  onItemPress: (id: Id) => void
}

export default ({ items, onItemPress }: Props) => {
  const aaa = items.map(item => item)
  return (
    <>
      {items.map((item) => (
        <TodoListItem key={item.id} item={item} onItemPress={logfn('bubble to todolist', onItemPress)} />
      ))}
    </>
  )
}
